function where(collection, source) {
  var arr = [];
  for(i=0;i<collection.length;i++){
      for(var x in source){
          if(source[x]===collection[i][x]){
              arr.push(collection[i]);
          }
      }
  }
  return arr;
}
```

```
function where(collection, source) {
  var arr = [];
  for(i=0;i<collection.length;i++){
      for(var prop in source){
          if(collection[i].hasOwnProperty(prop)){
          arr.push(collection[i]);
          }
      }
  }
  return arr;
}
```

